# Svelte & SvelteKit  
**This Note does not go into too much detail, it just explains *some* of the inner workings of Nook!**  

**Svelte** is a JavaScript framework used to build **fast and efficient** web applications.
> "Svelte is a radical new approach to building user interfaces. Whereas traditional frameworks like React and Vue do the bulk of their work in the browser, Svelte shifts that work into a compile step that happens when you build your app."  
> [svelte.dev](https://svelte.dev/)
**SvelteKit**, the companion framework to Svelte, provides additional features. It includes routing capabilities (Navigation between pages), server side rendering (Similar to PHP, but with a "hydration" step after load), and built-in support for static site generation.  

This site uses CSR (Client Side Rendering) as it is not possible to prerender pages on the server that use native browser features like IndexedDB.  
Nook makes heavy use of [+page.ts](https://kit.svelte.dev/docs/load#page-data) files. They retrieve data and the later export the data into a prop which can be used within a [+page.svelte](https://kit.svelte.dev/docs/routing#page-page-svelte) file.  
**Example:** The Explorer route uses a [+page.ts](https://github.com/frkri/Nook/blob/96e6231d3c94e0099734310c66d61a07c93bacad/src/routes/explorer/%5B...path%5D/%2Bpage.ts) to load all of the entries from IndexedDB and sort them by name and gives the data to [+page.svelte](https://github.com/frkri/Nook/blob/96e6231d3c94e0099734310c66d61a07c93bacad/src/routes/explorer/%5B...path%5D/%2Bpage.svelte) which displays the data using a Item component for each Item in the data prop.  

Svelte and many more frameworks have the concept of components, which are reusable pieces of code that can be used anywhere in a project. Nook for example uses a [Nav Bar component](https://github.com/frkri/Nook/blob/96e6231d3c94e0099734310c66d61a07c93bacad/src/lib/components/Nav.svelte).  
Svelte also offer a lot of Quality of Life features like [reactive variables](https://svelte.dev/docs#component-format-script-2-assignments-are-reactive) and [custom templates](https://svelte.dev/docs#template-syntax-each) removing a lot of boilerplate code.  

Here is a [store](https://svelte.dev/docs#run-time-svelte-store) which can be used anywhere and is reactive to changes. It also uses localstorage to store the value on each update. This code block uses Typescript for type support!
```
import { writable } from 'svelte/store';
// <boolean> defines the type the homepageSeen Store will be
export const homepageSeen = writable<boolean>(
    // We check the value in Localstorage (string) if it matches with the string 'true'
    localStorage.getItem('homepageSeen') === 'true'
);

homepageSeen.subscribe((value) => {
    // Localstorage can only support storing of strings
	localStorage.setItem('homepageSeen', value.toString());
});
```

# Storage

Under the hood of Nook, Multiple Storage Web APIs are used to store many types of files.
In addition [Typescript](https://www.typescriptlang.org/) is used for type safety.  

### [IndexedDB](https://developer.mozilla.org/en-US/docs/Web/API/IndexedDB_API)
- Provides Metadata about each Entry
```
// Type used to define a Entry
export interface EntryDataBasic {
	name: string;
	icon: string;
	type: EntryType;
}

export interface EntryData extends EntryDataBasic {
	id: string; // UUID
	modified: number; // UNIX Timestamp
	description: string;
}

const entryType = {
	Directory: 'directory',
	Note: 'note', // String content
	Img: 'image',
	Video: 'video',
	Audio: 'audio'
} as const;
export type EntryType = (typeof entryType)[keyof typeof entryType];
```
### [OPFS](https://developer.chrome.com/articles/origin-private-file-system/) (Origin Private File System)
- Provides the actual contents of a entry
- Referenced by its ID
- Can store anything, string or just binary
### [Local storage](https://developer.mozilla.org/en-US/docs/Web/API/Storage)
- Key Value Store
- Stores basic non-important data
Many user preferences and recently opened notes are stored there in JSON object in Localstorage
```
export const hotkeysEnabled = writable<boolean>(
localStorage.getItem('hotkeysEnabled') === 'true'
);
hotkeysEnabled.subscribe((value) => {
	localStorage.setItem('hotkeysEnabled', value.toString());
});
```
Every storage API (except OPFS) mentioned here can be accessed using Developer Tools for easy viewing.
